import React from 'react';
import styles from "./NavBar.module.css";
import Button from '../Button/Button';
import Logo from '../Logo/Logo';

const NavBar = () => {
  return (
    <nav className={styles.navbar}>
        <Logo />
        <Button />
    </nav>
  )
}

export default NavBar
